import "antd/dist/antd.css";
import NetworkDrawer from "./Components/DrawerNetwork";
import NavigationMenu from "./Components/MenuNavigation";
import DeviceManagementApp from "./DeviceManagement";
import Help from "./Help";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div>
      <Router>
        <div>
          <NavigationMenu />
          <Routes>
            <Route path="/" element={<NetworkDrawer />} />
            <Route path="/test" element={<DeviceManagementApp />} />
            <Route path="/help" element={<Help />} />
          </Routes>
        </div>
      </Router>
    </div>
  );
}

export default App;
